    var id = $(this).data("id");
    dataEquipment = {
      equiment:{
        active: true
      }
    }
    $.ajax({
        type: 'PATCH',
        url: "/equipment/"+id,
        data: dataEquipment,
        success: function(repsonse) {
            console.log(repsonse);
        },
        error: function(repsonse) {
        }
    })

  })
});
